def recognize_lp(en_lp, byte_arr):
    start = time.time()
    alpr = Alpr("eu", "/etc/openalpr/openalpr.conf", "/home/pi/openalpr/runtime_data")
    if not alpr.is_loaded():
        print("Error loading OpenALPR")
        return("-;false")
    if ";" in en_lp:
        en_lp_arr = en_lp.split(";")
    else:
        en_lp_arr = en_lp;
    alpr.set_top_n(10)
    alpr.set_default_region("cz")
    results = alpr.recognize_array(byte_arr)
    for plate in results['results']:
        for candidate in plate['candidates']:
            for lp in en_lp_arr:
                if lp == candidate['plate']:
                    save_image(byte_arr, "/home/pi/Desktop/"+candidate['plate']+";"+str(round((time.time()-start)*1000,3))+".jpg")
                    return(candidate['plate']+";"+str(round(candidate['confidence'], 3)))
    return("-;false")
    alpr.unload()

def save_image(byte_arr, save_path):
    image = Image.open(io.BytesIO(byte_arr))
    image.save(save_path)
